- Accord-cadre n°2023094-02 (Lot n°2)  à conclure avec la société STV ECO;
- Accord-cadre n°2023094-03 ( Lot 3 ) à conclure avec a société STV ECO;
- Accord-cadre n°2023M094-04 (Lot 4) à conclure avec la société COLLLECTA
